import React from 'react';
import "./album.module.scss"
const QuerySelect = () => {
    return (
        <div className="w-[260px] h-[65px] pl-6 pr-4 py-4 bg-[#0F0F0F] rounded-[15px] flex-col justify-center items-start gap-6 inline-flex">
            <div className="self-stretch justify-start items-center gap-6 inline-flex">
                <div className="grow shrink basis-0 flex-col justify-start items-start gap-0.5 inline-flex">
                    <div className="opacity-50 text-white text-lg font-bold font-['Raleway']">Год
                    </div>
                    <select className="text-white bg-[#0F0F0F] text-2xl font-medium font-['Raleway']">
                        <option>Ничего не выбрано</option>
                        <option>Ничего не выбрано</option>
                        <option>Ничего не выбрано</option>
                    </select>
                </div>

            </div>
        </div>
    );
};

export default QuerySelect;
